//级联get请求
export const loadCascaderGet = (data,url) => {
    return {
        url:url,
        method:'get',
        params:data,
        openMock:true
    }
}
//级联post请求
export const loadCascaderPost = (data,url) => {
    return {
        url:url,
        method:'post',
        data:data,
        openMock:true
    }
}
